import React from "react";

interface IProps {
  url: string;
}

const VideoMessage: React.FC<IProps> = ({ url }) => {
  return (
    <video width="320" height="240" controls>
      <source src={url} type="video/mp4" />
      <source src={url} type="video/ogg" />
    </video>
  );
};

export default VideoMessage;
